import axios from "axios";

//Get all Country data from database
export async function getData(){
	try{
		return await axios.get('http://localhost:4000/countries');
	}
	catch(err){
		console.log(err);
	}

}

//Get single Country data from database
export async function getSingleCountry(id){
	try{
		return await axios.get(`http://localhost:4000/countrie${id}`);
	}
	catch(err){
		console.log(err);
	}

}
